        private async void FutureShift(option[] opt)
        {
            if (opt[n].count != 0)
            {
                for (int i = 1; i < opt.Length; i++)
                {
                    opt[i - 1].ask = opt[i].ask;
                    opt[i - 1].bid = opt[i].bid;
                    opt[i - 1].count = opt[i].count;
                }
                opt[opt.Length - 1].count = 1;
            }
        }
