        private async Task CalculateOne(option[] opt)
        {
            if (n != 0)
            {
                if (opt[n].count != 0)
                {
                    opt[n].ask = opt[n].ask / opt[n].count;
                    if (opt[n].ask > 95 && n != 0 && opt[n].ask > 0)
                        opt[n].ask = opt[n - 1].ask;
                    opt[n].bid = opt[n].bid / opt[n].count;
                    if (opt[n].bid > 95 && n != 0)
                        opt[n].bid = opt[n - 1].bid;
                }
                if (n < 99 && opt[n].count != 0 && opt[n].bid > 0)
                {
                    opt[n + 1].ask = opt[n].ask;
                    opt[n + 1].bid = opt[n].bid;
                    opt[n + 1].count = 1;
                }
                if (n == 1 && opt[0].ask == 0 && opt[0].bid == 0)
                {
                    opt[n - 1].ask = opt[n].ask;
                    opt[n - 1].bid = opt[n].bid;
                    opt[n - 1].count = 1;
                }
            }
            else if (opt[0].ask != 0 && opt[0].bid != 0)
            {
                opt[n + 1].ask = opt[n].ask;
                opt[n + 1].bid = opt[n].bid;
                opt[n + 1].count = 1;
            }

        }
        private async Task BigCalculateOne(option[] opt)
        {
            if (bigN != 0)
            {
                if (opt[bigN].bigCount != 0)
                {
                    opt[bigN].bigAsk = opt[bigN].bigAsk / opt[bigN].bigCount;
                    if (opt[bigN].bigAsk != 0 && opt[bigN].bigAsk > 95 && bigN != 0)
                        opt[bigN].bigAsk = opt[bigN - 1].bigAsk;
                    opt[bigN].bigBid = opt[bigN].bigBid / opt[bigN].bigCount;
                    if (opt[bigN].bigBid != 0 && opt[bigN].bigBid > 95 && bigN != 0)
                        opt[bigN].bigBid = opt[bigN - 1].bigBid;
                }
                if (bigN < 99 && opt[bigN].bigCount != 0)
                {
                    opt[bigN + 1].bigAsk = opt[bigN].bigAsk;
                    opt[bigN + 1].bigBid = opt[bigN].bigBid;
                    opt[bigN + 1].bigCount = 1;
                }
            }
            else if (opt[0].bigAsk != 0 && opt[0].bigBid != 0 && opt[0].ask != QCLH24[0].ask)
            {
                opt[bigN + 1].bigAsk = opt[bigN].bigAsk;
                opt[bigN + 1].bigBid = opt[bigN].bigBid;
                opt[bigN + 1].bigCount = 1;
            }
        }
        private async void ProcessTimestamp(string sLine)
        {
            bigCounter++;
            counter++;
            /*if (counter == 23)*/
            if (counter == 4)
            {
                Calculate();
                if (n > 1)
                    DrawCharts();
                counter = 0;
                n++;
                futureN++;
                if (n == 100)
                {
                    n--;
                    Shift();
                }
                if (futureN == 100)
                {
                    futureN--;
                    FutureShift(QCLH24);
                }
            }
            if (bigCounter == 8)
            {
                BigCalculate();
                if (bigN > 1)
                    BigDrawCharts();
                bigCounter = 0;
                bigN++;
                bigfutureN++;
                if (bigN == 100)
                {
                    bigN--;
                    BigShift();
                }
                if (bigfutureN == 100)
                {
                    bigfutureN--;
                    BigFutureShift(QCLH24);
                }
            }
            UpdateListbox(sLine);
        }
