                            min = (o[i].bigAsk < min) ? o[i].bigAsk : min;
                        }

                        if (o[i].bigBid != 0)
                        {
                            max = (o[i].bigBid > max) ? o[i].bigBid : max;
                            min = (o[i].bigBid < min) ? o[i].bigBid : min;
                        }
                    }
                    step = (max - min) / 12;
                    j = 0;
                    for (int i = bigN - 1; i > 1; i--)
                    {
                        j++;
                        if ((o[i].bigAsk == 0 && o[i + 1].bigAsk == 0) || (o[i].bigBid == 0 && o[i + 1].bigBid == 0))
                        {

                        }
                        else
                        {
                            pix1 = 14 - (int)Math.Round((o[i].bigAsk - min) / step);
                            pix2 = 14 - (int)Math.Round((o[i + 1].bigAsk - min) / step);

                            pix3 = 14 - (int)Math.Round((o[i].bigBid - min) / step);
                            pix4 = 14 - (int)Math.Round((o[i + 1].bigBid - min) / step);

                            pix1 = (o[i].bigAsk == 0) ? pix2 : pix1;
                            pix2 = (o[i + 1].bigAsk == 0) ? pix1 : pix2;

                            pix3 = (o[i].bigBid == 0) ? pix4 : pix3;
                            pix4 = (o[i + 1].bigBid == 0) ? pix3 : pix4;

                            try
                            {
                                g.DrawLine(Pens.Green, 100 - j, pix1 - 1, 99 - j, pix2 - 1);
                                g.DrawLine(Pens.Red, 100 - j, pix3, 99 - j, pix4);
                            }
                            catch (OverflowException ex)
                            {

                            }
                        }
                    }
                    p.Image = bmp;
                    if (p.InvokeRequired)
                    {
                        p.Invoke((MethodInvoker)delegate { p.Refresh(); });
                        return;
                    }
                    p.Refresh();
                }
            }
        }
